  render()
  {
    return (
      <div>
        <Navstuff />
        {/* <div className='card-container'> */}
        <Shops shops={this.state.shops}></Shops>
        {/* </div> */}
        <TaggedContentCard
href = 'https://google.com'
thumbnail = 'https://s01.sgp1.digitaloceanspaces.com/large/892214-ba744794-1316-4b72-8e24-3f7f9e9ae85e.jpg'
title = '{shop.name}'
description = '{shop.description}'
tags = '{shop.category}'
/>
      </div>
    );
  }
}


export default App;
